import React from 'react';
import Print from "./components/test.js"





const App = () => {
  return (
    <>
    <div>
      <h1>Hello, It's my first React App!</h1>
       <h2>Happy Coding!!</h2>
       <h3>This is working!</h3>
    </div>
    <Print /> 
    </>

  );
};







export default App;
